import React, { useState, useEffect } from 'react';
import { motion, useAnimation } from 'framer-motion';
import { Card } from 'react-bootstrap';
import { Facebook, Twitter, Instagram, Linkedin } from 'react-feather';
import './hero.scss'; // Import the CSS file

export default function HomePage() {
  const [searchQuery, setSearchQuery] = useState('');
  const controls = useAnimation();

  useEffect(() => {
    controls.start({
      y: [0, -10, 0],
      transition: { repeat: Infinity, duration: 2 }
    });
  }, [controls]);

  const handleSearch = (e) => {
    e.preventDefault();
    console.log('Search query:', searchQuery);
  };

  return (
    <div className="home-container">
      <main className="main-content">
        {/* Hero Section */}
        <section className="hero-section">
          <motion.div 
            initial={{ opacity: 0.1, y: 50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            className="hero-text"
          >
            <h2 className="hero-title">Unlock Your Potential with Expert Mentorship</h2>
            <p className="hero-description">
              Connect with industry leaders, accelerate your career growth, and achieve your professional goals through personalized mentoring.
            </p>
            <div className="action-buttons">
              <button className="get-started-btn">Get Started</button>
              <form onSubmit={handleSearch} className="search-form">
                <input
                  type="text"
                  placeholder="Search for mentors or topics..."
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                  className="search-input"
                />
                <button type="submit" className="search-btn">Search</button>
              </form>
            </div>
          </motion.div>
          <motion.div
            animate={controls}
            className="scroll-down-icon"
          >
            <svg className="icon-bounce" fill="none" strokeLinecap="round" strokeLinejoin="round" strokeWidth="3" viewBox="0 0 24 24" stroke="currentColor">
              <path d="M19 14l-7 7m0 0l-7-7m7 7V3"></path>
            </svg>
          </motion.div>
        </section>

        {/* Features Section */}
        <section className="features-section">
          <div className="container">
            <h3 className="section-title">Key Features</h3>
            <div className="features-grid">
              <Card className="feature-card">
                <Card.Body>
                  <div className="feature-icon">
                    <svg className="icon" fill="none" strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" viewBox="0 0 24 24" stroke="currentColor">
                      <path d="M9 5l7 7-7 7"></path>
                    </svg>
                  </div>
                  <h4 className="feature-title">1:1 Video Mentoring</h4>
                  <p className="feature-description">High-quality, secure video conferencing for personalized mentoring sessions.</p>
                </Card.Body>
              </Card>

              <Card className="feature-card">
                <Card.Body>
                  <div className="feature-icon">
                    <svg className="icon" fill="none" strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" viewBox="0 0 24 24" stroke="currentColor">
                      <path d="M5 10h14M5 15h14"></path>
                    </svg>
                  </div>
                  <h4 className="feature-title">Smart Scheduling</h4>
                  <p className="feature-description">AI-powered scheduling to find the perfect time slot for both mentor and mentee.</p>
                </Card.Body>
              </Card>

              <Card className="feature-card">
                <Card.Body>
                  <div className="feature-icon">
                    <svg className="icon" fill="none" strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" viewBox="0 0 24 24" stroke="currentColor">
                      <path d="M4 6h16M4 10h16M4 14h16M4 18h16"></path>
                    </svg>
                  </div>
                  <h4 className="feature-title">Real-time Chat</h4>
                  <p className="feature-description">Instant messaging for quick questions and ongoing support between sessions.</p>
                </Card.Body>
              </Card>
            </div>
          </div>
        </section>
      </main>
    </div>
  );
}
